import React from "react";
import Card from "../UI/Card";

function CryptoData(){

    return(
        <Card>
            <table>
                <tr>
                    <th>Rank</th>
                    <th>Coin</th>
                    <th>P/L</th>
                    <th>Volume</th>

                </tr>
            </table>
        </Card>
    )
}

export default CryptoData;
